import React, { Component } from "react";

class CommentForm extends Component {
  state = {};
  render() {
    return (
      <form>
        <label>
          username:
          <input type="text" />
        </label>
        <label>
          Comment
          <input type="text" placeholder="have your say.." />
        </label>
        <button>Submit</button>
      </form>
    );
  }
}

export default CommentForm;
